import React, { Component } from 'react';
import Homehead from './Homehead';
import Homeswiper from './Homeswiper';

class Home extends Component {
    render() {
        return (
            <div>
                <Homehead />
                <Homeswiper key={this.state.datelist.length}/>
            </div>
        )
    }
}


export default Home
